def count_fibonacci_prints(T, N_list):
    L = [[1, 0], [0, 1]]
    for y in range(3, 41):
        Z = L[y - 1][0] + L[y - 2][0]
        V = L[y - 1][1] + L[y - 2][1]
        L.append([Z, V])
    result = []
    for N in N_list:
        result.append((L[N][0], L[N][1]))
    return result

